import { createAction } from '@reduxjs/toolkit';
import _ from 'lodash';

function createExtraActions(name, actions) {
  var extraActions = {};

  _.forIn(actions, function (value, key) {
    extraActions[key] = createAction("".concat(name, "/").concat(value));
  });

  return extraActions;
}

export default createExtraActions;
